import WhatsAppIcon from '@material-ui/icons/WhatsApp';
function Navbar() {
    return (
        <div className='navbar'>
            <div className='navLogo'>
                <WhatsAppIcon style={{ fontSize: 50 }} color='secondary' fontSize='large' />
                <span>Chat App</span>
            </div>
            <div className='navLinks'>

            </div>
        </div>
    )
}

export default Navbar
